(41, 'Praktyka fryzjerstwo', 'Szukamy pasjonatów fryzjerstwa na praktyki!\r\n\r\nJesteśmy renomowanym salonem fryzjerskim zlokalizowanym w centrum miasta.\r\nPoszukujemy entuzjastów branży, którzy\r\nchcieliby zdobyć praktyczne doświadczenie\r\nw świecie fryzjerstwa.\r\n\r\nCzego możesz się spodziewać:\r\n- Możliwość uczestnictwa w\r\nprofesjonalnych szkoleniach fryzjerskich.\r\n- Praktyka przy cięciu, stylizacji i\r\nkoloryzacji włosów.\r\n- Bezpośredni kontakt z klientami i\r\nbudowanie relacji.\r\n- Praca w przyjaznym zespole\r\nprofesjonalistów.\r\n\r\nOczekujemy:\r\n- Zaangażowania i chęci nauki.\r\n- Kreatywności i umiejętności interpersonalnych.\r\n- Chęci rozwijania umiejętności fryzjerskich.\r\n\r\nZapewniamy:\r\n- Praktyki w pełnym wymiarze godzin.\r\n- Możliwość stałego zatrudnienia po zakończeniu praktyk.\r\n- Przyjazne środowisko pracy.\r\n\r\nJeśli jesteś gotowy/a dołączyć do naszego zespołu i zdobywać doświadczenie w zawodzie fryzjera, czekamy na Twoje zgłoszenie!\r\n\r\nDo zobaczenia w świecie piękna włosów!\r\n', 'Brak', 2, 'Wrocław');

